    body:
      "#### Summary\r\n\r\n```javascript\r\nimport axios from 'axios'\r\nimport MockAdapter from 'axios-mock-adapter';\r\n\r\nconst mock = new MockAdapter(axios);\r\nconst api = axios.create({ baseURL: '/api' });\r\naxios.get('/method');\r\n```\r\n\r\nRequest url will be `/api/api/method` instead of `/api/method`.\r\n\r\nThis is because of two reasons:\r\n1. Function parameters mutation [here](https://github.com/axios/axios/blob/405fe690f93264d591b7a64d006314e2222c8727/lib/core/dispatchRequest.js#L30) \r\n2. Twice call of `dispatchRequest()` (first is [axios-mock-adapter](https://github.com/ctimmerm/axios-mock-adapter/blob/ae6d72571c995592c5090f0429a609eb1b422dd5/src/handle_request.js#L42), second is [default adapter](https://github.com/axios/axios/blob/4f98acc57860721c639f94f5772138b2af273301/lib/core/Axios.js#L68))\r\n\r\nAs a result we will run  ```config.url = combineURLs(config.baseURL, config.url)``` twice and get wrong result.\r\n\r\n#### Context\r\n\r\n- axios version: *0.18.0*\r\n- Environment: *node v11.6.0, chrome 71, macOS 10.14.2*\r\n",
